  during February 1941 - January 1942 for Lake Ardoch, Kellys Slough, Little Goose,
  Pioneer Lake, Wood Lake, Silver Lake, Lac Aux Mortes (Devil's Lake), Buffalo Lake,
  Johnson's Lake, Sibley Lake, Prairie Lake, Lambs Lake, Billings Lake, Rose Lake,
  Pleasant Lake. Water and wildlife are discussed. Followed by refuge development
  and maintenance, public relations, violations and field investigations or applied
